"     Patient information: Kidney stones in adults (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/kidney-stones-in-adults-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H295981368\">",
"      <span class=\"h1\">",
"       What are kidney stones?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Kidney stones are just what they sound like: Small stones that form inside the kidneys. They form when salts and minerals that are normally in the urine build up and harden.",
"     </p>",
"     <p>",
"      Kidney stones usually get carried out of the body when you urinate. But sometimes they can get stuck on the way out (",
"      <a class=\"graphic graphic_figure graphicRef79864 \" href=\"mobipreview.htm?26/28/27072\">",
"       figure 1",
"      </a>",
"      ). If that happens, the stones can cause:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Pain in your side or in the lower part of your belly",
"       </li>",
"       <li>",
"        Blood in the urine (which can make urine pink or red)",
"       </li>",
"       <li>",
"        Nausea or vomiting",
"       </li>",
"       <li>",
"        Pain when you urinate",
"       </li>",
"       <li>",
"        The need to urinate in a hurry",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H295981375\">",
"      <span class=\"h1\">",
"       How do I know if I have kidney stones?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your doctor or nurse thinks you have kidney stones, he or she can order an imaging test that can show the stones.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H295981382\">",
"      <span class=\"h1\">",
"       How are kidney stones treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Each person&rsquo;s treatment is a little different. The right treatment for you will depend on:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        The size, type, and location of your stone",
"       </li>",
"       <li>",
"        How much pain you have",
"       </li>",
"       <li>",
"        How much you are vomiting",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If your stone is big or causes severe symptoms, you may need to stay in the hospital. If your stone is small and causes only mild symptoms, you may be able to stay home and wait for it to pass in the urine. If you stay home, you will probably need to drink a lot of fluids. Plus, you may need to take pain medicines or medicines that make it easier to pass the stone.",
"     </p>",
"     <p>",
"      Stones that do not pass on their own can be treated with:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A machine that uses sound waves to break up stones into smaller pieces. This is called &ldquo;shock wave lithotripsy.&rdquo; This procedure does not involve surgery, but it can be painful.",
"       </li>",
"       <li>",
"        A special kind of surgery that makes very small holes in your skin. During this surgery, the doctor passes tiny tools through the holes and into the kidney. Then he or she removes the stone. This is called &ldquo;percutaneous nephrolithotomy.&rdquo;",
"       </li>",
"       <li>",
"        A thin tube that goes into your body the same way urine comes out. Doctors use tools at the end the tube to break up or remove stones. This is called &ldquo;ureteroscopy.&rdquo;",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H295981389\">",
"      <span class=\"h1\">",
"       What can I do to keep from getting kidney stones again?",
"      </span>",
"      &nbsp;&mdash;&nbsp;One simple thing you can do is to drink plenty of water. You might also need to change what you eat, depending on what your kidney stones were made of. If so, your doctor or nurse can tell you which foods to avoid. Your doctor or nurse might also prescribe you new medicines to keep you from having another kidney stone.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H295981396\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
