"    <a class=\"drug drug_general\" href=\"mobipreview.htm?25/19/25906?source=see_link\">",
"     see \"Sulfabenzamide, sulfacetamide, and sulfathiazole: Drug information\"",
"    </a>",
"    )",
"   </p>",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F223724\" xmlns=\"file://www.w3.org/1999/xhtml\">",
