" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Wilson disease simulating autoimmune hepatitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 387px; height: 252px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Liver biopsy from a patient with Wilson disease shows an island of parenchyma surrounded by thin connective tissue septa and inflammatory cells. These findings are identical to those seen in autoimmune chronic hepatitis, and this patient was treated unsuccessfully with corticosteroids before the correct diagnosis was made.",
