"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Note:",
"     </b>",
"     Dose is based on the amoxicillin component; see &ldquo;Augmentin&reg; Product-Specific Considerations\" table.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Susceptible infections:",
"     </b>",
"     Children &gt;40 kg and Adults: Oral: 250-500 mg every 8 hours or 875 mg every 12 hours",
"    </p>",
