"        </p>",
"       </td>",
"       <td align=\"left\">",
"        <p style=\"text-indent:0em;\">",
"         For adults having difficulty swallowing tablets, 125 mg/5 mL suspension may be substituted for 500 mg tablet.",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td align=\"center\" rowspan=\"3\" valign=\"middle\">",
