"     (Augmentin ES-600 Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     600-42.9 mg/5 mL (125 mL): $101.84",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Suspension (reconstituted)",
"     </b>",
"     (Augmentin Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     125-31.25 mg/5 mL (100 mL): $102.68",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     250-62.5 mg/5 mL (100 mL): $150.74",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablet, 12-hour",
"     </b>",
"     (Amoxicillin-Pot Clavulanate ER Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     1000-62.5 mg (28): $108.62",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablet, 12-hour",
"     </b>",
"     (Augmentin XR Oral)",
"    </p>",
