var title_f42_56_43914="ECG in Duchenne dystrophy";
var content_f42_56_43914=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F53681&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F53681&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1197px;\">",
"  <div class=\"figure\" style=\"width: 483px\">",
"   <div class=\"ttl\">",
"    Duchenne muscular dystrophy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 463px; height: 379px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Classic findings in Duchenne muscular dystrophy include resting sinus tachycardia, deep infero-lateral Q waves, and a tall R in lead V1 due to the underlying cardiomyopathy, which is often associated with posterobasal fibrosis of the left ventricle. Left atrial enlargement, as indicated by the prominent negative P wave in lead V1, and marked right axis deviation are also present.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Ary Goldberger, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 594px\">",
"   <div class=\"ttl\">",
"    Normal ECG",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 594px; height: 337px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal electrocardiogram showing normal sinus rhythm at a rate of 75 beats/min, a PR interval of 0.14 sec, a QRS interval of 0.10 sec, and a QRS axis of approximately 75&deg;.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Ary Goldberger, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
